import React from 'react';

function SimpleCalendar({ holidays, onDeleteHoliday, isAdmin = false }) {
  const currentYear = new Date().getFullYear();
  const currentMonth = new Date().getMonth();

  const monthNames = [
    'January', 'February', 'March', 'April', 'May', 'June',
    'July', 'August', 'September', 'October', 'November', 'December'
  ];

  const getDaysInMonth = (month, year) => {
    return new Date(year, month + 1, 0).getDate();
  };

  const getFirstDayOfMonth = (month, year) => {
    return new Date(year, month, 1).getDay();
  };

  const renderCalendar = (month, year) => {
    const daysInMonth = getDaysInMonth(month, year);
    const firstDay = getFirstDayOfMonth(month, year);
    const days = [];

    // Empty cells for days before the first day of the month
    for (let i = 0; i < firstDay; i++) {
      days.push(<div key={`empty-${i}`} className="calendar-day empty"></div>);
    }

    // Days of the month
    for (let day = 1; day <= daysInMonth; day++) {
      const dateStr = `${year}-${String(month + 1).padStart(2, '0')}-${String(day).padStart(2, '0')}`;
      const dayHolidays = holidays.filter(holiday => {
        const holidayDate = new Date(holiday.date);
        return holidayDate.getFullYear() === year && 
               holidayDate.getMonth() === month && 
               holidayDate.getDate() === day;
      });

      days.push(
        <div key={day} className={`calendar-day ${dayHolidays.length > 0 ? 'has-holiday' : ''}`}>
          <span className="day-number">{day}</span>
          {dayHolidays.map(holiday => (
            <div key={holiday._id} className="holiday-item">
              <span className="holiday-name">{holiday.name}</span>
              {isAdmin && (
                <button 
                  className="delete-btn"
                  onClick={() => onDeleteHoliday(holiday._id)}
                  title="Delete holiday"
                >
                  ×
                </button>
              )}
            </div>
          ))}
        </div>
      );
    }

    return days;
  };

  return (
    <div className="simple-calendar">
      <style jsx>{`
        .simple-calendar {
          background: var(--card-bg);
          border-radius: 8px;
          padding: 20px;
        }

        .calendar-grid {
          display: grid;
          grid-template-columns: repeat(7, 1fr);
          gap: 1px;
          background: var(--border-color);
          border-radius: 8px;
          overflow: hidden;
          margin-bottom: 20px;
        }

        .calendar-header {
          background: var(--primary-color);
          color: white;
          padding: 10px;
          text-align: center;
          font-weight: 600;
          font-size: 14px;
        }

        .calendar-day {
          background: var(--card-bg);
          min-height: 80px;
          padding: 8px;
          position: relative;
        }

        .calendar-day.empty {
          background: var(--bg-secondary);
        }

        .calendar-day.has-holiday {
          background: #fff3cd;
        }

        [data-theme="dark"] .calendar-day.has-holiday {
          background: #2d2a1f;
        }

        .day-number {
          font-weight: 600;
          color: var(--text-primary);
          font-size: 14px;
        }

        .holiday-item {
          background: var(--primary-color);
          color: white;
          padding: 2px 6px;
          border-radius: 4px;
          font-size: 10px;
          margin-top: 4px;
          display: flex;
          align-items: center;
          justify-content: space-between;
        }

        .holiday-name {
          flex: 1;
          overflow: hidden;
          text-overflow: ellipsis;
          white-space: nowrap;
        }

        .delete-btn {
          background: rgba(255, 255, 255, 0.2);
          border: none;
          color: white;
          width: 16px;
          height: 16px;
          border-radius: 50%;
          cursor: pointer;
          font-size: 12px;
          display: flex;
          align-items: center;
          justify-content: center;
          margin-left: 4px;
        }

        .delete-btn:hover {
          background: rgba(255, 255, 255, 0.3);
        }

        .month-title {
          text-align: center;
          font-size: 18px;
          font-weight: 600;
          color: var(--text-primary);
          margin-bottom: 15px;
        }
      `}</style>

      <div className="month-title">
        {monthNames[currentMonth]} {currentYear}
      </div>

      <div className="calendar-grid">
        <div className="calendar-header">Sun</div>
        <div className="calendar-header">Mon</div>
        <div className="calendar-header">Tue</div>
        <div className="calendar-header">Wed</div>
        <div className="calendar-header">Thu</div>
        <div className="calendar-header">Fri</div>
        <div className="calendar-header">Sat</div>
        {renderCalendar(currentMonth, currentYear)}
      </div>
    </div>
  );
}

export default SimpleCalendar;
